import './App.css';
import logo from './dnd-logo.svg';

function App() {
  return (
    <div className="App">
      <header className="border-b-2 p-4 bg-slate-700 text-white">
        <img src={logo} alt='logo'/>
        <h2 className="font-bold">DMH</h2>
      </header>
    </div>
  );
}

export default App;
